import Vue from "vue";
import Router from "vue-router";

import Layout from "@/components/Layout/Layout";
import Login from "@/pages/Login/Login";
import SignUp from "@/pages/SignUp/SignUp";
import AddAffiliate from "../src/pages/User/AddAffiliate";
import MyProfile from "../src/pages/User/myProfile";
import SentSMS from "../src/pages/User/SentSMS";
import CustemSMS from "../src/pages/User/CustemSMS";
import Users from "../src/pages/Admin/Users";
import AdminUsers from "../src/pages/Admin/SentSMS";
import ErrorPage from "@/pages/Error/Error";

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: "/",
      name: "Login",
      component: Login,
    },
    {
      path: "/signUp",
      name: "SignUp",
      component: SignUp,
    },
    {
      path: "/error",
      name: "Error",
      component: ErrorPage,
    },
    {
      path: "/logout",
      name: "logout",
    },
    {
      path: "/sms",
      name: "Layout",
      component: Layout,
      meta: {
        role: "User",
      },
      children: [
        {
          path: "addAffiliate",
          name: "Affiliate",
          component: AddAffiliate,
          meta: {
            role: "User",
          },
        },
        {
          path: "myProfile",
          name: "MyProfile",
          component: MyProfile,
          meta: {
            role: "User",
          },
        },
        {
          path: "SentSMS",
          name: "SentSMS",
          component: SentSMS,
          meta: {
            role: "User",
          },
        },
        {
          path: "custemSMS",
          name: "CustemSMS",
          component: CustemSMS,
          meta: {
            role: "User",
          },
        },
        {
          path: "users",
          name: "Users",
          component: Users,
          meta: {
            role: "Admin",
          },
        },
        {
          path: "AdminSentSMS",
          name: "SentSMS",
          component: AdminUsers,
          meta: {
            role: "Admin",
          },
        },
      ],
    },
  ],
  mode: "history",
});
